import React from 'react';

const Todos = ({todoList}) => {
    return (
        todoList.length ? (    
            todoList.map(todo => (
                <div className='todos collection' key={todo.id}>
                    <p>{todo.content}</p>
                </div>
            ))
        ) : (
            <p className='center'>You have no todos left, Yipee!</p>
        )
    );
}

export default Todos;
